import React from 'react';
import Nav from 'react-bootstrap/Nav';
import './AdminNavbarstyle.css'
import { Link, useNavigate } from 'react-router-dom';

function AdminNavbar() {
    const nvar=useNavigate()

    const onAdminLogout=()=>{
        localStorage.removeItem("userId")
        nvar
    }
  return (
    <div>
        <div className='adminnav'>
                  <Nav defaultActiveKey="/home">
                      <Nav.Item>
                          <Nav.Link href="/home" className='adminnavbaritem'><Link to={'/adminhome'}>Home</Link></Nav.Link>
                      </Nav.Item>
                      <Nav.Item>
                          <Nav.Link eventKey="link-1" className='adminnavbaritem'><Link to={'/adminuserlist'}>List of Users</Link></Nav.Link>
                      </Nav.Item>
                      <Nav.Item>
                          <Nav.Link eventKey="link-1" className='adminnavbaritem'><Link to={'/adminnotify'}>Notifications</Link></Nav.Link>
                      </Nav.Item>
                      <Nav.Item>
                          <Nav.Link eventKey="link-1" className='adminnavbaritem'><button onClick={onAdminLogout}>Logout</button></Nav.Link>
                      </Nav.Item>
                  </Nav>
              </div>
    </div>
  )
}

export default AdminNavbar
